import React, { Component } from 'react';

import { BrowserRouter, Switch, Route } from 'react-router-dom';

import axios from 'axios';

import Home from './pages/Home';

class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}

	componentDidMount() {}

	render() {
		return (
			<BrowserRouter>
				<Switch>
					<Route path="/" exact component={Home} />
				</Switch>
			</BrowserRouter>
		);
	}
}

export default App;
